import telegramIcon from '../assest/image/svg/telegramIcon.svg';

export const SOCIAL_MEDIA = [
    {name: 'whatsapp', img: whatsappIcon, href: 'whatsapp://send?phone=+79955961569'},
    {name: 'VK', img: VKicon, href: 'https://vk.com/tivergroup'},
    {name: 'telegram', img: telegramIcon, href: 'https://telegram.me/+79668882749'},
    {name: 'viber', img: viberIcon, href: ''},
];
